var omelette = require('omelette')
var completion = omelette('hello <name> <surname>')

// This is your logic
completion.on('name', ({ reply }) => {
  reply(['fatih', 'rotimi'])
})
completion.on('surname', ({ reply }) => {
  reply(['akin', 'best'])
})

completion.init()

